  return (
    <Layout>
      <BlogPost posts={posts} />
      <style global jsx>{``}</style>
    </Layout>
  );
}

Posts.getInitialProps = async () => ({
  posts: await client.fetch(groq`
      *[_type == 'post' && defined(mainImage)]{ 
      ...,
      "mainImage": mainImage.asset->
